		const int pointer_graph_size = 59605;

		using PropertyT = long long;
		using HashForest = lhf::LatticeHashForest<PropertyT>;

		HashForest latticeHashForest;
		lhf::LatticeHashForest<int> PointsToSetForest;

		inline PropertyT getProperty(const PointerPointee& pointer_pointee) const {
			if (std::find(pointer_graph.begin(), pointer_graph.end(), pointer_pointee) == pointer_graph.end()) {
				throw std::out_of_range("Invalid Pointer Pointee Pair");
			}
			PropertyT property = (static_cast<PropertyT>(pointer_pointee.first) << 32) | (static_cast<unsigned int>(pointer_pointee.second));
			return property;
		}

		inline PointerPointee getPointerPointee(const PropertyT& property) const {
			int pointer = static_cast<int>(property >> 32);
			int pointee = static_cast<int>(property & 0xFFFFFFFF);
			return {pointer, pointee};
		}

	public:

		PointerGraph() {}

		inline int getTokenId(const std::string& var, const std::string& scope, const std::string& line) {
			auto it = token_map.find({var, scope, line});
			return (it != token_map.end()) ? it->second : -1;
		}

		inline PtrData getTokeDetails (int id) {
			for (const auto& [key, value] : token_map) {
				if (value == id) {
					return key;
				}
			}
			throw std::out_of_range("ID not found in token_map");
		}

		inline lhf::Index getEmptySetIndex() {
			return lhf::EMPTY_SET;
		}

		inline bool is_empty(lhf::Index i) {
			return latticeHashForest.is_empty(i);
		}

		inline bool is_subset(lhf::Index a, lhf::Index b) {
			HashForest::SubsetRelation rel = latticeHashForest.is_subset(a, b);
			return rel == HashForest::SubsetRelation::SUBSET;
		}

		inline bool is_superset(lhf::Index a, lhf::Index b) {
			HashForest::SubsetRelation rel = latticeHashForest.is_subset(a, b);
			return rel == HashForest::SubsetRelation::SUPERSET;
		}
				
		inline lhf::Index getEdgeIndex(const PointerPointee& pp) {
			PropertyT property = getProperty(pp);
			return latticeHashForest.register_set_single(property);
		}

		inline lhf::Index getEdgeIndex(const PointerPointee& pp, bool &cold) {
			PropertyT property = getProperty(pp);
			return latticeHashForest.register_set_single(property, cold);
		}

		inline const HashForest::PropertySet &get_value(lhf::Index idx) const {
			return latticeHashForest.get_value(idx);
		}

		inline std::size_t size_of(lhf::Index idx) const {
			return latticeHashForest.size_of(idx);
		}

		inline bool contains(lhf::Index idx, const PointerPointee& pp) const {
			PropertyT property = getProperty(pp);
			return latticeHashForest.contains(idx, property);
		}

		lhf::Index set_union(lhf::Index a, lhf::Index b) {
			return latticeHashForest.set_union(a, b);
		}

		lhf::Index set_insert_single(lhf::Index a, const PointerPointee& pp) {
			PropertyT property = getProperty(pp);
			return latticeHashForest.set_insert_single(a, property);
		}

		lhf::Index set_remove_single(lhf::Index a, const PointerPointee& pp) {
			PropertyT property = getProperty(pp);
			return latticeHashForest.set_remove_single(a, property);
		}

		lhf::Index set_difference(lhf::Index a, lhf::Index b) {
			return latticeHashForest.set_difference(a, b);
		}

		lhf::Index set_intersection(lhf::Index a, lhf::Index b) {
			return latticeHashForest.set_intersection(a, b);
		}


		inline const lhf::LatticeHashForest<int>::PropertySet &get_value_points_to(lhf::Index idx) const {
			return PointsToSetForest.get_value(idx);
		}

		lhf::Index get_points_to_set(lhf::Index a, int id) {
			HashForest::PropertySet property_set = latticeHashForest.get_value(a);
			std::vector<int> result;
			for (PropertyT property : property_set) {
				PointerPointee pp = getPointerPointee(property);
				if (pp.first == id) {
					result.push_back(pp.second);
				}
			}
			return PointsToSetForest.register_set(result);
		}

		lhf::Index get_points_to_set(lhf::Index a, std::vector<int> ids) {
			lhf::Index result = getEmptySetIndex();
			for (int id: ids) {
				lhf::Index index = get_points_to_set(a, id);
				result = PointsToSetForest.set_union(result, index);
			}
			return result;
		}

		lhf::Index get_points_to_set(lhf::Index a, lhf::Index idx) {
			return get_points_to_set(a, get_value_points_to(idx));
		}

		lhf::Index get_points_to_set(lhf::Index a, int id, int recursion_depth) {
			if (recursion_depth <= 0) {
				return {};
			}
			lhf::Index result = get_points_to_set(a, id);

			for (int i = 1; i < recursion_depth; i++) {
				result = get_points_to_set(a, result);
				if (PointsToSetForest.is_empty(result)) {
					break;
				}
			}
			return result;
		}

		lhf::Index get_points_to_set(lhf::Index a, std::vector<int> ids, int recursion_depth) {
			if (recursion_depth <= 0) {
				return {};
			}
			lhf::Index result = get_points_to_set(a, ids);

			for (int i = 1; i < recursion_depth; i++) {
				result = get_points_to_set(a, result);
				if (PointsToSetForest.is_empty(result)) {
					break;
				}
			}
			return result;
		}

		void print_points_to_set(lhf::Index idx) {
			auto property_set = PointsToSetForest.get_value(idx);
			std::cout << "Points-to set (Index = " << idx << "): ";
			std::cout << "("; 
			for (const auto& property : property_set) {
				std::cout << property << ", ";
			}
			std::cout << ")" << std::endl;
		}
